import styled from "styled-components";
import { desktop } from "../../constants/breakpoints";
import { OXFORD_BLUE } from "../../constants/colors";

export const Page = styled.div`
  padding-top: 4rem;
  background-color: ${OXFORD_BLUE};
`;

export const MainContent = styled.main`
  margin: 0 2rem;
  height: 100vh;
  overflow: scroll;

  ${desktop} {
    margin: 0 8rem;
  }
`;
